import React from 'react';
import Services from './components/Services';
import servicesData from './data/services'

function App() {
  return (
    <div>
      <h1>Pro Ride Coaching</h1>

      {servicesData.map((service, key) => (
        <Services  img={service.img} title={service.title} description={service.description} btnText={service.btnText} />
      ))}
    </div>
  );
}

export default App;
